import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import NavBar from "./component/Navbar/Navbar";
import About from "./component/About/About";
import FindTheOne from "./component/FindTheOne/FindTheOne";
import FavoritCards from "./component/FavoritCards/FavoritCards";
import Register from "./component/Register/Register";
import MyCards from "./component/Cards/Cards"; // Updated import to MyCards
import SandBox from "./component/SandBox/SandBox";
import Footer from "./component/Footer/Footer";
import Bla from "./component/Bla";
import PrivateRoute from "./component/PrivateRoute";
import { ThemeProvider } from "./hooks/DarkMode/DarkModeContext";
import { UserProvider } from "./hooks/UserHooks/userContextApp";
import "./hooks/DarkMode/DarkMode.css";

function App() {
  return (
    <ThemeProvider>
      <UserProvider>
        <BrowserRouter>
          <NavBar />
          <Routes>
            <Route path="/" element={<About />} />
            <Route path="/FindTheOne" element={<FindTheOne />} />
            <Route path="/favCards" element={<PrivateRoute element={<FavoritCards />} roles={['admin', 'business']} />} />
            <Route path="/myCards" element={<PrivateRoute element={<MyCards />} roles={['admin', 'business']} />} />
            <Route path="/register" element={<Register />} />
            <Route path="/sandBox" element={<PrivateRoute element={<SandBox />} roles={['admin']} />} />
            <Route path="/Bla" element={<PrivateRoute element={<Bla />} roles={['business']} />} />
          </Routes>
          <Footer />
        </BrowserRouter>
      </UserProvider>
    </ThemeProvider>
  );
}

export default App;
